		public VarData FindVar(string name)
		{
			Block par = curBlock;
			while (!par.varTable.ContainsKey(name))
			{
				par = par.Parent;
				if (par == null)
				{
					break;
				}
			}                                
			if (par == null)
			{
				Error($"Unknown var {name}!!!");
			}
			return par?.varTable[name];
		} 
		
